const Dashboard = () => {
  const [isLoggedIn, setIsLoggedIn] = useState(false);

  const userId = Cookies.get('UserId');
  if (userId !== null) {
    setIsLoggedIn(true);
    Cookies.remove('UserId');
    return <Navigate to="/Auth/Login" />; // Navigate here only if logged in with cookie
  }

  const handleLogout = () => {
    Cookies.remove('UserId');
    setIsLoggedIn(false);
  };

  if (!isLoggedIn) {
    return <Navigate to="/Auth/Login" />;
  }

  return ( // Render Dashboard content only if logged in
    <div>
      <h1>Welcome to Dashboard</h1>
      <button onClick={handleLogout}>Logout</button>
    </div>
  );
};
